import React from 'react';
import '../BestPhotoGraphy/BestPhotoGraphy.css'
import Deer from "../../Assests/Gallery/Rectangle 17.png";
import Tiger from "../../Assests/BestPhotoGraphy/tiger.jpg"
import Tiger2 from "../../Assests/BestPhotoGraphy"

const BestPhotoGraphy = () => {
  return (
    <div>
      <div className="container ml-[80px]">
        <div className="box box-1" data-text="Renji"> <img src={Deer}/></div>
        <div className="box box-2" data-text="Sora"><img src={fox}/></div>
        <div className="box box-3"  data-text="Kaito"><img src={zeebra}/></div>
        <div className="box box-4" data-text="Tsuki"><img src={deer2}/></div>
        <div className="box box-5" data-text="Mitsui"><img src={Deer}/></div>
      </div>
    </div>
  );
};

export default BestPhotoGraphy;
